INSERT INTO test_question_multiple_choice VALUES("135","16","<p>A number when divided successively by 4 and 5 leaves remainders 1 and 4 respectively. When it is successively divided by 5 and 4, then the respective remainders will be</p>","<p>1, 2</p>","<p>2, 3</p>\n<p>&nbsp;</p>","<p>3, 2</p>\n<p>&nbsp;</p>","<p>4, 1</p>","","2","modorate","<p>4 | x&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; y = (5 x 1 + 4) = 9<br />&nbsp;--------<br />&nbsp;5 | y -1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; x = (4 x y + 1) = (4 x 9 + 1) = 37<br />&nbsp;--------<br />&nbsp;&nbsp; | 1 -4<br /><br />&nbsp;Now, 37 when divided successively by 5 and 4, we get<br /><br />&nbsp;5 | 37<br />&nbsp;---------<br />&nbsp;4 | 7 - 2<br />&nbsp;---------<br />&nbsp;&nbsp; | 1 - 3<br />&nbsp;<br />&nbsp;Respective remainders are 2 and 3.</p>","ashokkumar@gmail.com","Multiple-Option");
INSERT INTO test_question_multiple_choice VALUES("136","16","<p>8796 x 223 + 8796 x 77 = ?</p>","<p>2736900</p>\n<p>&nbsp;</p>","<p>2638800</p>\n<p>&nbsp;</p>","<p>2658560</p>\n<p>&nbsp;</p>","<p>2716740</p>\n<p>&nbsp;</p>","<p>None of these</p>","2","easy","<p>8796 x 223 + 8796 x 77 &nbsp;&nbsp;&nbsp; = 8796 x (223 + 77)[Ref: By Distributive Law ]<br />= (8796 x 300)<br />= 2638800</p>","ashokkumar@gmail.com","Multiple-Option");
