INSERT INTO test_question_multiple_choice VALUES("163","16","<p>If the product 4864 x 9 P 2 is divisible by 12, then the value of P is:</p>","<p>2</p>","<p>5</p>\n<p>&nbsp;</p>","<p>6</p>\n<p>&nbsp;</p>","<p>8</p>\n<p>&nbsp;</p>","<p>None of these</p>\n<p>&nbsp;</p>","5","modorate","<p>Clearly, 4864 is divisible by 4.<br /><br />So, 9P2 must be divisible by 3. So, (9 + P + 2) must be divisible by 3.<br /><br />P = 1.</p>","ashokkumar@gmail.com","Multiple-Option");
INSERT INTO test_question_multiple_choice VALUES("164","16","<p>Which one of the following is the common factor of (4743 + 4343) and (4747 + 4347) ?</p>","<p>(47 - 43)</p>\n<p>&nbsp;</p>","<p>(47 + 43)</p>\n<p>&nbsp;</p>","<p>(47^43 + 43^43)</p>\n<p>&nbsp;</p>","<p>None of these</p>\n<p>&nbsp;</p>","","2","modorate","<p>When n is odd, (xn + an) is always divisible by (x + a).<br /><br />Each one of (4743 + 4343) and (4747 + 4347) is divisible by (47 + 43).</p>","ashokkumar@gmail.com","Multiple-Option");
INSERT INTO test_question_multiple_choice VALUES("165","16","<p>-84 x 29 + 365 = ?</p>","<p>2436</p>","<p>2801</p>\n<p>&nbsp;</p>","<p>-2801</p>\n<p>&nbsp;</p>","<p>-2071</p>\n<p>&nbsp;</p>","<p>None of these</p>\n<p>&nbsp;</p>","4","easy","<p>Given Exp. &nbsp;&nbsp;&nbsp; = -84 x (30 - 1) + 365<br />&nbsp;&nbsp;&nbsp; = -(84 x 30) + 84 + 365<br />&nbsp;&nbsp;&nbsp; = -2520 + 449<br />&nbsp;&nbsp;&nbsp; = -2071</p>","ashokkumar@gmail.com","Multiple-Option");
INSERT INTO test_question_multiple_choice VALUES("166","16","<p>A number when divided by 296 leaves 75 as remainder. When the same number is divided by 37, the remainder will be:</p>","<p>1</p>","<p>2</p>\n<p>&nbsp;</p>","<p>8</p>\n<p>&nbsp;</p>","<p>11</p>\n<p>&nbsp;</p>","","1","modorate","<p>Let x = 296q + 75<br /><br />&nbsp;&nbsp; = (37 x 8q + 37 x 2) + 1<br /><br />&nbsp;&nbsp; = 37 (8q + 2) + 1<br /><br />Thus, when the number is divided by 37, the remainder is 1.</p>","ashokkumar@gmail.com","Multiple-Option");
