DROP TABLE IF EXISTS branch;

CREATE TABLE `branch` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `college` varchar(255) NOT NULL,
  `course` varchar(255) NOT NULL,
  `branch` varchar(255) NOT NULL,
  `college_code` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=530 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS college;

CREATE TABLE `college` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `short_name` varchar(255) NOT NULL,
  `state` varchar(255) NOT NULL,
  `university` varchar(255) NOT NULL,
  `college_code` varchar(255) NOT NULL,
  `college_email` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=86 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS course;

CREATE TABLE `course` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `course` varchar(255) NOT NULL,
  `college` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=85 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS instance;

CREATE TABLE `instance` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `college` varchar(255) NOT NULL,
  `instance` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS knowledgebase_category;

CREATE TABLE `knowledgebase_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `category` varchar(255) NOT NULL,
  `weight` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS knowledgebase_content;

CREATE TABLE `knowledgebase_content` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `category` varchar(255) NOT NULL,
  `file` varchar(255) NOT NULL,
  `addeddate` date NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS materials;

CREATE TABLE `materials` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `college` varchar(255) NOT NULL,
  `file` varchar(255) NOT NULL,
  `addeddate` date NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS message;

CREATE TABLE `message` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `message` longtext NOT NULL,
  `sentfrom` varchar(255) NOT NULL,
  `to` varchar(255) NOT NULL,
  `college` varchar(255) NOT NULL,
  `course` varchar(255) NOT NULL,
  `branch` varchar(255) NOT NULL,
  `date` date NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS notice;

CREATE TABLE `notice` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `date` varchar(255) NOT NULL,
  `title` varchar(255) NOT NULL,
  `content` longtext NOT NULL,
  `cc` varchar(255) NOT NULL,
  `cordinator` varchar(255) NOT NULL,
  `addeddate` date NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS online_test;

CREATE TABLE `online_test` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `test_id` varchar(255) NOT NULL,
  `CATEGORY` varchar(255) NOT NULL,
  `optinal` varchar(20) NOT NULL,
  `TOTAL_NO_QUESTION` varchar(50) NOT NULL,
  `EACH_QUE_MARK_CORRECT` varchar(50) NOT NULL,
  `EACH_QUE_MARK_WRONG` varchar(50) NOT NULL,
  `test_name` varchar(50) NOT NULL,
  `CAT_NAME` varchar(100) NOT NULL,
  `DATE_TIME_START` varchar(255) NOT NULL,
  `duration` varchar(50) NOT NULL,
  `DATE` varchar(100) NOT NULL,
  `STATUS` varchar(100) NOT NULL,
  `MAX_DATE` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=22 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS pi;

CREATE TABLE `pi` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `REGD_NO` varchar(255) NOT NULL,
  `INTERVIEWER` varchar(255) NOT NULL,
  `CLARITY` int(11) NOT NULL,
  `ARTICULATION` int(11) NOT NULL,
  `USAGES` int(11) NOT NULL,
  `CONFIDENCE` int(11) NOT NULL,
  `BODY_LANG` int(11) NOT NULL,
  `LISTENING` int(11) NOT NULL,
  `APPEARANCE` int(11) NOT NULL,
  `MANNERS` int(11) NOT NULL,
  `COMM_FEEDBACK` text NOT NULL,
  `PREP_FEEDBACK` text NOT NULL,
  `OTHER_FEEDBACK` text NOT NULL,
  `RATING` int(11) NOT NULL,
  `TIME_START` varchar(255) NOT NULL,
  `TIME_END` varchar(255) NOT NULL,
  `TIME_TAKEN` varchar(255) NOT NULL,
  `DATE` date NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS questions;

CREATE TABLE `questions` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `question` text NOT NULL,
  `subject_id` varchar(31) NOT NULL,
  `cat_id` int(11) NOT NULL,
  `ans1` text NOT NULL,
  `ans2` text NOT NULL,
  `ans3` text NOT NULL,
  `ans4` text NOT NULL,
  `ans5` text,
  `ans6` text NOT NULL,
  `corans` varchar(8) NOT NULL DEFAULT '',
  `difficulty` varchar(100) NOT NULL,
  `expl` text NOT NULL,
  `company` text NOT NULL,
  `test` text NOT NULL,
  `source` varchar(100) NOT NULL,
  `weight ratio` text NOT NULL,
  `test_names` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=168 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS search;

CREATE TABLE `search` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `college` text NOT NULL,
  `yop` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS signup;

CREATE TABLE `signup` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(255) NOT NULL,
  `password` varchar(255) NOT NULL,
  `email` varchar(255) NOT NULL,
  `fname` varchar(255) NOT NULL,
  `lname` varchar(255) NOT NULL,
  `C_code` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS staff;

CREATE TABLE `staff` (
  `ID` int(10) NOT NULL AUTO_INCREMENT,
  `Staff_Name` varchar(100) NOT NULL,
  `User_Name` varchar(100) NOT NULL,
  `Gender` varchar(50) NOT NULL,
  `DOB` date NOT NULL,
  `Address` text NOT NULL,
  `Mobile` varchar(12) NOT NULL,
  `Email` varchar(50) NOT NULL,
  `Password` varchar(50) NOT NULL,
  `Photo` varchar(255) NOT NULL,
  `C_Code` varchar(100) NOT NULL,
  `Role` varchar(50) NOT NULL,
  `Status` varchar(50) NOT NULL,
  `actingrole` varchar(255) NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=33 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS state;

CREATE TABLE `state` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `state` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS student_data;

CREATE TABLE `student_data` (
  `REG_NO` varchar(20) NOT NULL,
  `USERNAME` varchar(255) NOT NULL,
  `PASSWORD` varchar(255) NOT NULL,
  `NAME` varchar(100) NOT NULL,
  `GENDER` varchar(100) NOT NULL,
  `DOB` date NOT NULL,
  `MOBILE_NO` varchar(100) NOT NULL,
  `EMAIL_ID` varchar(100) NOT NULL,
  `STATE` varchar(255) NOT NULL,
  `UNIVERSITY` varchar(255) NOT NULL,
  `COLLEGE` varchar(100) NOT NULL,
  `COLLEGE_FULLNAME` varchar(255) NOT NULL,
  `COURSE` varchar(255) NOT NULL,
  `BRANCH` varchar(50) NOT NULL,
  `COURSE_YOP` int(11) NOT NULL,
  `PIC` varchar(100) NOT NULL,
  `C_Code` varchar(255) NOT NULL,
  PRIMARY KEY (`REG_NO`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS student_result;

CREATE TABLE `student_result` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `email` varchar(100) NOT NULL,
  `test_id` varchar(255) NOT NULL,
  `cat_id` varchar(255) NOT NULL,
  `question_attend` varchar(255) NOT NULL,
  `question_ans` varchar(250) NOT NULL,
  `total_mark` int(11) NOT NULL,
  `score` int(11) NOT NULL,
  `unanswered` int(11) NOT NULL,
  `status` varchar(20) NOT NULL,
  `correct_ans` varchar(100) NOT NULL,
  `reg_no` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=21 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS temp_test_result;

CREATE TABLE `temp_test_result` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `test_id` varchar(255) NOT NULL,
  `candidate` varchar(255) NOT NULL,
  `question_id` int(11) NOT NULL,
  `answer` int(11) NOT NULL,
  `stime` varchar(255) NOT NULL,
  `etime` varchar(255) NOT NULL,
  `instance` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS test_category;

CREATE TABLE `test_category` (
  `category_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `parent_category_id` int(11) NOT NULL,
  PRIMARY KEY (`category_id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS test_config;

CREATE TABLE `test_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `test_id` varchar(255) NOT NULL,
  `section` varchar(255) NOT NULL,
  `category` varchar(255) NOT NULL,
  `question_type` varchar(255) NOT NULL,
  `no_of_question` int(11) NOT NULL,
  `mark_of_each_question` int(11) NOT NULL,
  `negative_marking` int(11) NOT NULL,
  `duration` time NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS test_difficulty_level;

CREATE TABLE `test_difficulty_level` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `level` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS test_question;

CREATE TABLE `test_question` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `test_id` varchar(255) NOT NULL,
  `question_id` longtext NOT NULL,
  `c_id` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=48 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS test_question_multiple_choice;

CREATE TABLE `test_question_multiple_choice` (
  `question_id` int(11) NOT NULL AUTO_INCREMENT,
  `category` varchar(255) NOT NULL,
  `question` longtext NOT NULL,
  `choice1` varchar(255) NOT NULL,
  `choice2` varchar(255) NOT NULL,
  `choice3` varchar(255) NOT NULL,
  `choice4` varchar(255) NOT NULL,
  `choice5` varchar(255) NOT NULL,
  `answer` varchar(255) NOT NULL,
  `difficulty_level` varchar(255) NOT NULL,
  `explanation` longtext NOT NULL,
  `question_added_by` varchar(255) NOT NULL,
  `question_type` varchar(255) NOT NULL,
  PRIMARY KEY (`question_id`)
) ENGINE=InnoDB AUTO_INCREMENT=220 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS test_question_true_false;

CREATE TABLE `test_question_true_false` (
  `question_id` int(11) NOT NULL AUTO_INCREMENT,
  `category` varchar(255) NOT NULL,
  `question` longtext NOT NULL,
  `choice1` varchar(255) NOT NULL,
  `choice2` varchar(255) NOT NULL,
  `answer` varchar(255) NOT NULL,
  `difficulty_level` varchar(255) NOT NULL,
  `explanation` longtext NOT NULL,
  `question_added_by` varchar(255) NOT NULL,
  `question_type` varchar(255) NOT NULL,
  PRIMARY KEY (`question_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS test_questionset;

CREATE TABLE `test_questionset` (
  `test_id` varchar(255) NOT NULL,
  `section` varchar(255) NOT NULL,
  `category` varchar(255) NOT NULL,
  `type` varchar(255) NOT NULL,
  `difficulty` int(11) NOT NULL,
  `easy` int(11) NOT NULL,
  `moderate` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS test_section;

CREATE TABLE `test_section` (
  `section_id` int(11) NOT NULL AUTO_INCREMENT,
  `section_name` varchar(255) NOT NULL,
  `category` varchar(255) NOT NULL,
  PRIMARY KEY (`section_id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS test_section_category;

CREATE TABLE `test_section_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `test_id` varchar(255) NOT NULL,
  `section_name` varchar(255) NOT NULL,
  `category` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS test_section_setting;

CREATE TABLE `test_section_setting` (
  `test_id` varchar(255) NOT NULL,
  `section` varchar(255) NOT NULL,
  `eachquestionmark` float NOT NULL,
  `eachwronganswer` float NOT NULL,
  `time` varchar(255) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS test_setting;

CREATE TABLE `test_setting` (
  `test_id` varchar(255) NOT NULL DEFAULT '',
  `start_date` datetime NOT NULL,
  `end_date` datetime NOT NULL,
  `for_college` varchar(255) NOT NULL,
  `for_yop` varchar(255) NOT NULL,
  `duration` varchar(255) NOT NULL,
  `calculator` varchar(255) NOT NULL,
  `instance` int(11) NOT NULL,
  KEY `test_id` (`test_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS test_status;

CREATE TABLE `test_status` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `test_id` varchar(255) NOT NULL,
  `candidate` varchar(255) NOT NULL,
  `status` varchar(255) NOT NULL,
  `instance` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS test_tests;

CREATE TABLE `test_tests` (
  `test_id` varchar(255) NOT NULL,
  `test_name` varchar(255) NOT NULL,
  `sections` text NOT NULL,
  `status` enum('y','n') NOT NULL,
  PRIMARY KEY (`test_id`),
  UNIQUE KEY `test_id` (`test_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS ti;

CREATE TABLE `ti` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `REGD_NO` varchar(255) NOT NULL,
  `INTERVIEWER` varchar(255) NOT NULL,
  `PER_DISPOSITION` int(11) NOT NULL,
  `CAREER` int(11) NOT NULL,
  `COMMUNICATION` int(11) NOT NULL,
  `KNOWLEDGE_AREA` int(11) NOT NULL,
  `IT_AWARNESS` int(11) NOT NULL,
  `CONFIDENCE` int(11) NOT NULL,
  `TECH_FEEDBACK` text NOT NULL,
  `OTHER_FEEDBACK` text NOT NULL,
  `RATING` int(11) NOT NULL,
  `TIME_START` varchar(255) NOT NULL,
  `TIME_END` varchar(255) NOT NULL,
  `TIME_TAKEN` varchar(255) NOT NULL,
  `DATE` date NOT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS university;

CREATE TABLE `university` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `university` varchar(255) NOT NULL,
  `state` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=latin1;



